import{isEncodedDataUrl,isSvgDataUrl,isValid}from"../validate";describe("isValid",()=>{it("invalid onload attr",()=>{expect(isValid({nodeType:1,nodeName:"svg",attributes:[{name:"onload"}],childNodes:[]})).toBe(!1)}),it("invalid onclick attr",()=>{expect(isValid({nodeType:1,nodeName:"svg",attributes:[{name:"OnClIcK"}],childNodes:[]})).toBe(!1)}),it("invalid child SCRIPT elm",()=>{expect(isValid({nodeType:1,nodeName:"svg",attributes:[],childNodes:[{nodeType:1,nodeName:"SCRIPT",attributes:[],childNodes:[]}]})).toBe(!1)}),it("invalid script elm",()=>{expect(isValid({nodeType:1,nodeName:"script",attributes:[],childNodes:[]})).toBe(!1)}),it("is valid circle elm",()=>{expect(isValid({nodeType:1,nodeName:"circle",attributes:[],childNodes:[]})).toBe(!0)}),it("is valid SVG elm",()=>{expect(isValid({nodeType:1,nodeName:"SVG",attributes:[],childNodes:[{nodeType:1,nodeName:"line",attributes:[],childNodes:[]}]})).toBe(!0)}),it("is valid text node",()=>{expect(isValid({nodeType:3,nodeName:"#text"})).toBe(!0)})}),it("isSvgDataUrl",()=>{expect(isSvgDataUrl("data:image/svg+xml;base64,xxx")).toBe(!0),expect(isSvgDataUrl("data:image/svg+xml;utf8,<svg></svg>")).toBe(!0),expect(isSvgDataUrl("https://example.com/icon.svg")).toBe(!1),expect(isSvgDataUrl("http://example.com/icon.svg")).toBe(!1)}),it("isEncodedDataUrl",()=>{expect(isEncodedDataUrl("data:image/svg+xml;base64,xxx")).toBe(!1),expect(isEncodedDataUrl("data:image/svg+xml;utf8,<svg></svg>")).toBe(!0),expect(isEncodedDataUrl("https://example.com/icon.svg")).toBe(!1),expect(isEncodedDataUrl("http://example.com/icon.svg")).toBe(!1)});